script: |
  super -f text -I q13951.spq | sort > q13951.out

inputs:
  - name: q13951.spq
    data: |
      SELECT DISTINCT + ( + + col2 ) + - col2 + - ( + - col1 ) + + col2 * - col2 + + 25 * col1 AS col2 FROM tab1 (FORMAT parquet) WHERE NOT NULL = - + col1;
  - name: tab1

outputs:
  - name: q13951.out
    data: |
